(0xb4262055cf5d4fcfa777d97402d677e3, 0x0ed15e1599924b08823f60bb496f1e03, '{{ salesChannel.name }}', 'Bitte besttigen Sie Ihre E-Mail-Adresse bei {{ salesChannel.name }}', 'Anmeldebesttigung bei Gastbestellungen', '\n            <div style=\"font-family:arial; font-size:12px;\">\n                <p>\n                    Hallo {{ customer.salutation.displayName }} {{ customer.lastName }},<br/>\n                    <br/>\n                    Bitte besttigen Sie Ihre E-Mail-Adresse ber den nachfolgenden Link:<br/>\n                    <br/>\n                    <a href=\"{{ confirmUrl }}\">E-Mail besttigen</a><br/>\n                    <br/>\n                    Nach der Besttigung werden Sie in den Bestellabschluss geleitet, dort knnen Sie Ihre Bestellung nochmals berprfen und abschlieen.<br/>\n                    Durch diese Besttigung erklren Sie sich ebenso damit einverstanden, dass wir Ihnen im Rahmen der Vertragserfllung weitere E-Mails senden drfen.\n                </p>\n            </div>\n        ', '\n            Hallo {{ customer.salutation.displayName }} {{ customer.lastName }},\n\n            Bitte besttigen Sie Ihre E-Mail-Adresse ber den nachfolgenden Link:\n\n            {{ confirmUrl }}\n\n            Nach der Besttigung werden Sie in den Bestellabschluss geleitet, dort knnen Sie Ihre Bestellung nochmals berprfen und abschlieen.\n            Durch diese Besttigung erklren Sie sich ebenso damit einverstanden, dass wir Ihnen im Rahmen der Vertragserfllung weitere E-Mails senden drfen.\n        ', NULL, '2022-08-01 16:07:00.334', NULL),
(0xb4262055cf5d4fcfa777d97402d677e3, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, '{{ salesChannel.name }}', 'Please confirm your email address at {{ salesChannel.name }}', 'Email confirmation at guest orders', '\n            <div style=\"font-family:arial; font-size:12px;\">\n                <p>\n                    Hello {{ customer.salutation.displayName }} {{ customer.lastName }},<br/>\n                    <br/>\n                    Please confirm your email address via the following link:<br/>\n                    <br/>\n                    <a href=\"{{ confirmUrl }}\">Confirm email</a><br/>\n                    <br/>\n                    After the confirmation, you will be directed to the checkout, where you can check and complete your order again.<br/>\n                    By this confirmation, you also agree that we may send you further emails as part of the fulfillment of the contract.\n                </p>\n            </div>\n        ', '\n            Hello {{ customer.salutation.displayName }} {{ customer.lastName }},\n\n            Please confirm your email address via the following link:\n\n            {{ confirmUrl }}\n\n            After the confirmation, you will be directed to the checkout, where you can check and complete your order again.\n            By this confirmation, you also agree that we may send you further emails as part of the fulfillment of the contract.\n        ', NULL, '2022-08-01 16:07:00.334', NULL),
(0xb485c8d1c64741a9acef379fe5c2aee9, 0x0ed15e1599924b08823f60bb496f1e03, '{{ salesChannel.name }}', 'Ihr Hndleraccountantrag wurde abgelehnt - {{ salesChannel.name }}', 'Kundengruppenwechsel abgelehnt', '<div style=\"font-family:arial; font-size:12px;\">\n    <p>\n        Hallo,<br/>\n        <br/>\n        elen Dank fr ihr Interesse an unseren Grohandelspreisen. Leider liegt uns bisher keine <br/>\n        Hndlerauthentifizierung vor, und daher knnen wir Ihre Anfrage nicht besttigen. <br/>\n        Bei weiteren Fragen kontaktieren Sie uns gerne per Telefon, Fax oder E-Mail. <br/>\n    </p>\n</div>', '\n        Hallo,\n\n        vielen Dank fr ihr Interesse an unseren Grohandelspreisen. Leider liegt uns bisher keine\n        Hndlerauthentifizierung vor, und daher knnen wir Ihre Anfrage nicht besttigen.\n        Bei weiteren Fragen kontaktieren Sie uns gerne per Telefon, Fax oder E-Mail.\n    ', NULL, '2022-08-01 16:06:58.553', NULL),
(0xb485c8d1c64741a9acef379fe5c2aee9, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, '{{ salesChannel.name }}', 'Your trader account has not been accepted - {{ salesChannel.name }}', 'Customer Group Change rejected', '<div style=\"font-family:arial; font-size:12px;\">\n    <p>\n        Hello,<br/>\n		<br/>\n        thank you for your interest in our trade prices.\n        Unfortunately, we do not have a trading license yet so that we cannot accept you as a merchant.<br/>\n        In case of further questions please do not hesitate to contact us via telephone, fax or email.\n    </p>\n</div>', '\n        Hello,\n\n        thank you for your interest in our trade prices. Unfortunately,\n        we do not have a trading license yet so that we cannot accept you as a merchant.\n        In case of further questions please do not hesitate to contact us via telephone, fax or email.\n    ', NULL, '2022-08-01 16:06:58.552', NULL),
