(0xdea99f6fefdc4df4bc7cdc494499818b, 0x0ed15e1599924b08823f60bb496f1e03, '{{ salesChannel.name }}', 'Password zurcksetzen - {{ salesChannel.name }}', 'Anfrage zum Zurcksetzen des Passworts', '<div style=\"font-family:arial; font-size:12px;\">\n    <p>\n        Hallo {{ customer.salutation.translated.letterName }} {{customer.firstName}} {{ customer.lastName }},<br/>\n        <br/>\n        im Shop {{ salesChannel.translated.name }} wurde eine Anfrage gestellt, um Ihr Passwort zurck zu setzen.\n        Bitte besttigen Sie den unten stehenden Link, um ein neues Passwort zu definieren.<br/>\n        <br/>\n        <a href=\"{{ resetUrl }}\">Passwort zurcksetzen</a><br/>\n        <br/>\n        Dieser Link ist nur fr die nchsten 2 Stunden gltig. Danach muss das Zurcksetzen des Passwortes erneut beantragt werden.\n        Falls Sie Ihr Passwort nicht zurcksetzen mchten, ignorieren Sie diese E-Mail - es wird dann keine nderung vorgenommen.\n    </p>\n</div>', 'Hallo {{ customer.salutation.translated.letterName }} {{customer.firstName}} {{ customer.lastName }},\n\nim Shop {{ salesChannel.translated.name }} wurde eine Anfrage gestellt, um Ihr Passwort zurck zu setzen.\nBitte besttigen Sie den unten stehenden Link, um ein neues Passwort zu definieren.\n\nPasswort zurcksetzen: {{ resetUrl }}\n\nDieser Link ist nur fr die nchsten 2 Stunden gltig. Danach muss das Zurcksetzen des Passwortes erneut beantragt werden.\nFalls Sie Ihr Passwort nicht zurcksetzen mchten, ignorieren Sie diese E-Mail - es wird dann keine nderung vorgenommen.', NULL, '2022-08-01 16:06:58.549', NULL),
